import React, { useEffect, useState } from "react";
import {
  GoogleMap,
  InfoBox,
  Marker,
  useLoadScript,
} from "@react-google-maps/api";
import { theme } from "@/themes/theme";
import { Divider, Typography, Box, Stack } from "@mui/material";
import LocationOnIcon from "@mui/icons-material/LocationOn";
import CallIcon from "@mui/icons-material/Call";
import MailIcon from "@mui/icons-material/Mail";

// const google = window.google;

const containerStyle = {
  width: "100%",
  height: "354px",
};

const center = {
  lat: 19.180266046430003,
  lng: 72.83467974462253,
};

function Mymap() {
  const { isLoaded } = useLoadScript({
    googleMapsApiKey: "AIzaSyAOdub2Y9pGTV12OkIps6C4VG35xtPoydc",
  });

  const [marker, setMarker] = useState(false);
  const markerClick = () => {
    setMarker(true);
  };

  const markerClose = () => {
    setMarker(false);
  };

  return isLoaded ? (
    <GoogleMap mapContainerStyle={containerStyle} center={center} zoom={14}>
      <Marker
        position={center}
        icon={{
          url: "https://d2inycshohpmtw.cloudfront.net/Content/wrapper/img/icons/aboutus-5nanceLogo.png",
        }}
      />
      <InfoBox position={new google.maps.LatLng(center.lat, center.lng)}>
        <Box
          width="50%"
          height="20%"
          sx={{ backgroundColor: "red", padding: "6px" }}
        >
          <Stack direction="row" pt={1} pb={1}>
            <LocationOnIcon
              fontSize="medium"
              sx={{ color:"#fff", mr: "5px", ml: "1px" }}
            />
            <Divider
              orientation="vertical"
              flexItem
              sx={{
                mx: 1,
                width: "2px",
                backgroundColor: "red",
              }}
            />
            <Typography
              textAlign="left"
              color="#fff"
              sx={{ fontSize: "12px", wordBreak: "break-word" }}
            >
              A 703/ 704 , Eureka Towers, Mindspace, Malad(West) Mumbai-400064
            </Typography>
          </Stack>
          <Divider
            sx={{
              backgroundColor: "red",
            }}
          />
          <Stack direction="row" pt={1} pb={1} alignItems="center">
            <CallIcon
              sx={{ color: "#fff", mr: "5px", ml: "1px" }}
            />
            <Divider
              orientation="vertical"
              flexItem
              sx={{
                mx: 1,
                width: "2px",
                backgroundColor: "red",
              }}
            />
            <Typography
              textAlign="center"
              color="#fff"
              sx={{
                fontSize: "12px",
                wordBreak: "break-word",
                pt: 0.5,
                pb: 0.5,
              }}
            >
              +91-8048131677
            </Typography>
          </Stack>
          <Divider
            sx={{
              backgroundColor: theme.extraColor.mapDivider,
            }}
          />

          <Stack direction="row" pt={1} alignItems="center">
            <MailIcon
              sx={{ color: theme.palette.common.white, mr: "5px", ml: "1px" }}
            />
            <Divider
              orientation="vertical"
              flexItem
              sx={{
                mx: 1,
                width: "2px",
                backgroundColor: theme.extraColor.mapDivider,
              }}
            />
            <Typography
              textAlign="center"
              color={theme.palette.common.white}
              sx={{
                fontSize: "12px",
                wordBreak: "break-word",
                pt: 0.5,
                pb: 0.5,
              }}
            >
              customercare@5nance.com
            </Typography>
          </Stack>
        </Box>
      </InfoBox>
    </GoogleMap>
  ) : (
    <></>
  );
}
export default Mymap;
